import React from "react";
import { Link } from "react-router-dom";
import Green from '../Green';


function Nav() {
  const stationsList = [
    {
      name: 'red',
      display: 'Red'
    },
    {
      name: 'green',
      display: 'Green'
    },
    {
      name: 'yellow',
      display: 'Yellow'
    },
    {
      name: 'blue',
      display: 'Blue'
    },
    {
      name: 'orange',
      display: 'Orange'
    },
    {
      name: 'silver',
      display: 'Silver'
    },

  ]


  function showNavigation()  {
      return (
        <div>
          <ul className="flex-row">
            <li>
              <Link to="/green">
                Green
              </Link>
            </li>
            <li>

            </li>
          </ul>
        </div>
      );
  }

  return (
    <header className="flex-row">
      <h1>
        <Link to="/">
          <span role="img" aria-label="Back2Better Logo"></span>
        </Link>
      </h1>

      <nav>
        {showNavigation()}
      </nav>
    </header>
  );
}

export default Nav;
